<p>how do i delete out one specific <strong>answer comment</strong> ??</p>
<pre class="lang-js prettyprint-override"><code>
const Schemaa = mongoose.Schema({

    questionBody: String,
    Comment:[{
       commentBody: String,   
    }],
    answer: [{
        answerBody: String,
        Comment:[{
            commentBody:String,    /// i want to delete one specific comment having a unique
        }]                         ///  'Object _id.
    }]
})
export default mongoose.model(&quot;Questions&quot;, Schemaa)

</code></pre>
<p>I used the below code, to <strong>Add a comment in answers section</strong> and it worked fine...</p>
<pre class="lang-js prettyprint-override"><code>
const updatedQuestion = await Schemaa.updateOne(
            { 'answer._id' : answerId},              /// I passed that specific answer's _id   
            { $push: {                               ///  as answerId
           &quot;answer.$.Comment&quot;: { 
             commentBody}
            } 
           })

</code></pre>
<p>regards.</p>

