<p><em>a brief breakdown:</em> I have many objects like this one in the collection. they are a kind of an audit log for actions takes on other documents, 'Match(es)'. for example <code>CREATE</code> + the data, <code>UPDATE</code> + the data, etc.</p>
<p>As you can see, <code>logs</code> field of the document is an array of objects, each describing one of these actions.
<code>data</code> for each action <strong>may or may not</strong> contain specific fields, that in turn can also be an array of objects: <code>socialLinks</code> and <code>webResults</code>.</p>
<p>I'm trying to remove sensitive data from <strong>all</strong> of these documents with specified Match ids.
For each document, I want to go over the <code>logs</code> array field, and change the value of specific fields <strong>only if they exist</strong>, for example: change <code>firstName</code> to <code>*****</code>, same for <code>lastName</code>, if those appear. also, go over the <code>socialLinks</code> array if exists, and for each element inside it, if a field <code>url</code> exists, change it to <code>*****</code> as well.</p>
