        'logs.$[].data.talent.webResults.$[].title': '*****',
        'logs.$[].data.talent.firstName': '*****',
        'logs.$[].data.talent.lastName': '*****',
      },
</code></pre>
<p>and some play around with this kind of aggregation query:</p>
<pre><code>[{
      $set: {
        'talent.socialLinks.$[el].url': {
          $cond: [{ $ne: ['el.url', null] },'*****', undefined],
        },
      },
    }]
</code></pre>
<p>resulting in errors like: <code> message: &quot;The path 'logs.0.data.talent.socialLinks' must exist in the document in order to apply array updates.&quot;,</code></p>
<p>But I just cant get it to work... :(</p>
<p>Would love an explanation on how to exactly achieve this kind of set-only-if-exists behaviour.
A working example would also be much appreciated, thx.</p>

